let [state, setState]=({
    list:[]
});

const TodoReducer=(state,action)=>{
switch(action.type){
    case "TO_ADD":{
    return {list : [...state.list, setState(action.payload)]}
    }
    default : {
 return{state}
    }
}
}
export default TodoReducer;
